import os
import requests
import time
from datetime import datetime
from threading import Thread

# Function to download a file from a URL and save it to the specified directory


def download_file(url, directory, logfile):
    filename = os.path.join(directory, url.split('/')[-1].split('?')[0])  # Only use the part before '?'
    response = requests.get(url, stream=True)
    total_size = int(response.headers.get('content-length', 0))
    block_size = 1024 #1 Kbyte
    total_kb = total_size // block_size
    log_interval_kb = 1000000  # Log every 50000 KB downloaded

    with open(filename, 'wb') as file:
        for data in response.iter_content(block_size):
            file.write(data)
            done_kb = file.tell() // block_size
            if done_kb % log_interval_kb == 0: # every 50000 KB
                percentage = (done_kb / total_kb) * 100 if total_kb != 0 else 100
                write_log(logfile, url, f'Downloading... {done_kb}KB of {total_kb}KB ({percentage:.2f}% completed)')

    write_log(logfile, url, 'Download completed')

# Function to write a log file with information about the download process
def write_log(logfile, url, status):
    with open(logfile, 'a') as file:
        timestamp = datetime.now().strftime("%Y-%m-%d %H:%M:%S")
        file.write(f"{timestamp} - URL: {url}, Status: {status}\n")
        
        
        
        

